import React, { useContext, useState, useEffect } from "react";
import { UserContext } from "../contexts/UserContext";

const Cart = () => {
  const { users } = useContext(UserContext);
  const userName = users.userName;
  console.log(users);
  return <h1> Cart {userName} </h1>;
};

export default Cart;
